/** script for portfolio */
function Download() {
  const resumeContentBase64 =
    ""; // Replace with your base64-encoded PDF content

  // Convert the base64-encoded string to a Uint8Array
  const resumeContentArray = Uint8Array.from(atob(resumeContentBase64), (c) =>
    c.charCodeAt(0)
  );

  // Create a Blob with the content and specify the MIME type as 'application/pdf'
  const blob = new Blob([resumeContentArray], { type: "application/pdf" });

  // Create a URL for the Blob object
  const url = URL.createObjectURL(blob);

  // Create an anchor element to trigger the download
  const downloadLink = document.createElement("a");
  downloadLink.href = url;

  // Set the default file name for the download
  downloadLink.download = "SIVABHARATH_RESUME.pdf";

  // Append the anchor element to the document
  document.body.appendChild(downloadLink);

  // Simulate a click event to trigger the download
  downloadLink.click();

  // Clean up the URL object after the download
  URL.revokeObjectURL(url);
}

